  ways State agencies, School Food Authorities (SFA) participating in the National
  School Lunch and SchoolrnBreakfast Programs (NSLP and SBP), institutions participating
  in the Child and Adult Care Food Program (CACFP), and sponsors participating in
  thernSummer Food Service Program (SFSP) can respond to situationsrnresulting from
